        setSchemaName(event.target.value);
    }
    console.log(schemaName)
    return(
        <>
            <input
                type="text"
                placeholder="Enter Schema Name"
                value={schemaName}
                onChange={handleSchemaNameChange}
            />
        </>
    )
}
